object ThreeEqualParts extends App {
  private def toBin(arr:Array[Int],i: Int,j: Int): Int = {
     var s = 0
     var k = i
     var p = j - i
     while(p >= 0) {
        s += (1 * arr(k)) << p
        k += 1
        p -= 1
     }
     s
  }

  def threeEqualParts(arr: Array[Int]): Array[Int] = {
      val i1 = 0
      for(len1 <- 1 to arr.length - 1) {
         val i2 = i1 + len1
         if(i2 < arr.length) {
           val a = toBin(arr, i1, i2 - 1)
           for(len2 <- 1 to arr.length - 1) {
             val i3 = i2 + len2
             if(i3 < arr.length){
               val b = toBin(arr, i2, i3 - 1)
               if(a == b && i3 < arr.length && i2 < i3) {
                 val c = toBin(arr, i3, arr.length-1)
                 if(a == c) return Array(i2-1, i3)
               }
             }
           }
         }
      }
      Array(-1, -1)
  }
